import React, { Component } from 'react'
import { Router, Switch, Route } from "react-router-dom";
import Registration from './components/Registration';
import Formcomponent from './components/Formcomponent';
import history from './history';
import Tweets from './components/Tweets';
import UserProfile from './components/UserProfile';
import follow from './components/follow';
import timeline from './components/timeline';
import Edit from './components/Edit';
import DisplayFollowings from './components/DisplayFollowings';
import followers from './components/followers';
import HomePage from "./components/HomePage"
import axios from 'axios';
import User from './components/User';
import SideBar from './components/SideBar';
import Parent from './components/Parent';
import UniversalSearch from "./components/UniversalSearch"

class Routes extends Component {
    constructor(props) {
        super(props)

        this.state = {

        }
    }


    render() {
        return (
            <div>

                <Router history={history}>
                   <Switch>
                       <Route path="/" exact   component={HomePage}></Route>
                       <Route path="/Registration"  component={Registration}></Route>
                       <Route path="/Login" component={Formcomponent}></Route>
                       <Route path="/Timeline/:id"  component={timeline}></Route>
                       {/* <Route path="/UserProfile" component={UserProfile}></Route> */}
                       <Route path="/UserProfile/:userid" component={UserProfile}></Route>
                       <Route path="/Tweets/:id" component={Tweets}  ></Route>
                       <Route path="/Edit/:id" component={Edit}></Route>
                       <Route path="/Followings/:id" component={DisplayFollowings}></Route>
                       <Route path="/Followers/:id" component={followers}></Route>

                  </Switch> 
                </Router>

            </div>
        )
    }
}

export default Routes
